import './ascent.css';
import React from 'react';

import apis from '../../api';

class Ascent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {teams: []};
    }

    componentDidMount = async () => {
        await apis.getTeamsByMap('Ascent').then(res => {
            this.setState({
                teams: res.data.data,
            })
        })
    }
    
    render() {
        const team = this.state;

        console.log(team[0]);
        return (
            <div>
                {team[0]}
            </div>
        )
    }
};

export default Ascent;
